import http from "./httpService";
import apiUrl from '../config.json'

export function registerRegularUser(user){
    return http.post(apiUrl + "/Auth/register/regular", {
        email: "",
      password: "",
      repeatedPassword: "",
      name: "",
      lastName: "",
      gender: "",
      residenceAddress: "",
      city: "",
      country: "",
      phoneNumber: "",
      jmbg: "",
      profession: "",
      workLocation: "",
    });
}
